/* ONE dark UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
atom-text-editor .entity.name.tag.block.any.html.angular,
atom-text-editor::shadow .entity.name.tag.block.any.html.angular,
atom-text-editor .entity.other.attribute-name.html.angular,
atom-text-editor::shadow .entity.other.attribute-name.html.angular {
  color: #e2c08d;
}
atom-text-editor .punctuation.definition.block.begin.angular,
atom-text-editor::shadow .punctuation.definition.block.begin.angular,
atom-text-editor .punctuation.definition.block.end.angular,
atom-text-editor::shadow .punctuation.definition.block.end.angular {
  color: #73c990;
}
